import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom"; // ✅ import navigate

export default function BrowseProjects() {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [bidAmounts, setBidAmounts] = useState({});
  const [message, setMessage] = useState("");
  const [searchTerm, setSearchTerm] = useState(""); // ✅ added state

  const token = localStorage.getItem("token");
  const freelancerId = localStorage.getItem("userId");
  const navigate = useNavigate(); // ✅ navigation hook

  useEffect(() => {
    if (!token) {
      setError("You are not logged in!");
      setLoading(false);
      return;
    }

    const fetchProjects = async () => {
      try {
        const response = await axios.get("http://localhost:8080/projects", {
          headers: { Authorization: `Bearer ${token}` },
        });
        setProjects(response.data);
      } catch (err) {
        console.error(err.response || err);
        setError("Error fetching projects.");
      } finally {
        setLoading(false);
      }
    };

    fetchProjects();
  }, [token]);

  const handleBidChange = (projectId, value) => {
    setBidAmounts({ ...bidAmounts, [projectId]: value });
  };

  const submitProposal = async (projectId) => {
    const bidAmount = bidAmounts[projectId];
    if (!bidAmount || isNaN(bidAmount) || bidAmount <= 0) {
      setMessage("Please enter a valid bid amount.");
      return;
    }

    try {
      await axios.post(
        "http://localhost:8080/proposal",
        {
          projectId,
          freelancerId: Number(freelancerId),
          bidAmount: Number(bidAmount),
        },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setMessage("Proposal submitted successfully!");
      setBidAmounts({ ...bidAmounts, [projectId]: "" });
    } catch (err) {
      console.error(err.response || err);
      setMessage("Error submitting proposal. Maybe you already submitted one.");
    }
  };

  // ✅ filter projects by search term
  const filteredProjects = projects.filter((project) =>
    project.title.toLowerCase().includes(searchTerm.toLowerCase())
  );

  if (loading) return <p>Loading projects...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>All Projects</h2>

      {/* ✅ Search bar */}
      <input
        type="text"
        placeholder="Search projects by name..."
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
        style={{
          padding: "8px",
          marginBottom: "15px",
          width: "100%",
          maxWidth: "400px",
          borderRadius: "5px",
          border: "1px solid #ccc",
        }}
      />

      {message && <p style={{ color: "green" }}>{message}</p>}
      {filteredProjects.length === 0 ? (
        <p>No projects available at the moment.</p>
      ) : (
        <ul style={{ listStyle: "none", padding: 0 }}>
          {filteredProjects.map((project) => (
            <li
              key={project.id}
              style={{
                marginBottom: "15px",
                border: "1px solid #ccc",
                padding: "10px",
                borderRadius: "5px",
              }}
            >
              <h3>{project.title}</h3>
              <p>
                <strong>Description:</strong> {project.description}
              </p>
              <p>
                <strong>Budget:</strong> {project.minBudget} - {project.maxBudget}
              </p>
              <p>
                <strong>Deadline:</strong>{" "}
                {new Date(project.deadline).toLocaleDateString()}
              </p>
              <p>
                <strong>Skills:</strong> {project.skills.join(", ")}
              </p>
              <p>
                <strong>Status:</strong> {project.status}
              </p>

              {/* ✅ View Client Profile */}
              <button
                style={{
                  padding: "5px 10px",
                  background: "#007BFF",
                  color: "#fff",
                  border: "none",
                  borderRadius: "5px",
                  marginRight: "10px",
                  cursor: "pointer",
                }}
                onClick={() => navigate(`/profile/${project.clientId}`)}
              >
                View Client Profile
              </button>

              {/* Bid input */}
              <div style={{ marginTop: "10px" }}>
                <input
                  type="number"
                  placeholder="Enter your bid"
                  value={bidAmounts[project.id] || ""}
                  onChange={(e) => handleBidChange(project.id, e.target.value)}
                  style={{ padding: "5px", marginRight: "5px" }}
                />
                <button
                  onClick={() => submitProposal(project.id)}
                  style={{ padding: "5px 10px" }}
                >
                  Submit Proposal
                </button>
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
